    public function testInstanceOfBuchinYoutube()
    {
    	$youtube = new Youtube();
    	$this->assertInstanceOf('Buchin\Youtube\Youtube', $youtube);
    }

    public function testSearchFunctionality()
    {
    	$this->browser->shouldReceive('get')
    	->once()
    	->andReturn($this->response);

    	$youtube = new Youtube();

    	$response = $youtube->search('Minecraft Music');
    	$videos = $response['videos'];

    	$this->assertNotEmpty($videos);
    	$this->assertInternalType('array', $videos);
    	$this->assertArrayHasKey('author', $videos[0]);
    }

    public function testVideoHasProperFormat()
    {
    	$raw_response = json_decode($this->response, true);
    	$raw_video = $raw_response['feed']['entry'][1];
    	$youtube = new Youtube();
    	$video = $youtube->format($raw_video);

    	$this->assertArrayHasKey('youtubeid', $video, 'Video did not has Youtube ID');
    	$this->assertArrayHasKey('title', $video, 'Video should have a title');
    	$this->assertArrayHasKey('excerpt', $video);
    	$this->assertArrayHasKey('views', $video);
    	$this->assertArrayHasKey('author', $video);
    	$this->assertArrayHasKey('thumbnail', $video);
    	$this->assertArrayHasKey('likes', $video);
    	$this->assertArrayHasKey('aspect_ratio', $video);
    	$this->assertArrayHasKey('duration', $video);

    }

